        IsIPAddress: IsIPAddress,
        ValidateTime: ValidateTime,
        ValidateTimeFromTo: ValidateTimeFromTo,
        ValidateDateFromTo: ValidateDateFromTo,
        ValidateDate: IsDate,
        IsFullSizeKatakana: IsFullSizeKatakana,
